<p><span class='_5mfr'><span class='_6qdm'>­ЪЉЅ</span></span>( 1 - 3 ) рђЏрђђрђ║<br />рђЏрђГрђ»рђИрђЏрђГрђ»рђИрђљрђ»рђЋрђ║рђђрђйрђ▒рђИ рђАрђќрђ╗рђгрђИрђћрђ▓рђирђљрђ░рђљрђџрђ║рЂІ<span class='text_exposed_show'><br />рђАрђќрђ╗рђгрђИрђёрђйрђ▒рђирђёрђйрђ▒рђирђюрђ▒рђИрђЏрђЙрђГрђЎрђџрђ║рЂІ рђЂрђ▒рђФрђёрђ║рђИрђћрђірђ║рђИрђћрђірђ║рђИрђђрђГрђ»рђђрђ║рђЎрђџрђ║рЂІ рђюрђірђ║рђЂрђ╗рђ▒рђгрђёрђ║рђИрђћрђгрђЎрђџрђ║рЂІ рђАрђЁрђгрђИрђАрђърђ▒рђгрђђрђ║рђЎрђЋрђ╗рђђрђ║рђўрђ░рђИрЂІ рђЁрђгрђИрђћрђГрђ»рђёрђ║рђърђ▒рђгрђђрђ║рђћрђГрђ»рђёрђ║рђљрђџрђ║рЂІ</span></p>
<div class='text_exposed_show'>
<p><span class='_5mfr'><span class='_6qdm'>­ЪЉЅ</span></span>( 4 ) рђЏрђђрђ║&zwnj;рђЎрђ╝рђ▒рђгрђђрђ║рђћрђ▒рђи<br />рђАрђќрђ╗рђгрђИрђёрђйрђ▒рђирђёрђйрђ▒рђирђюрђ▒рђИрђЋрђ▓ рђЏрђЙрђГрђћрђ▒рђдрђИрђЎрђџрђ║рЂІ<br />рђюрђірђ║рђЂрђ╗рђ▒рђгрђёрђ║рђИрђћрђірђ║рђИрђћрђірђ║рђИрђЋрђГрђ»рђћрђгрђюрђгрђЎрђџрђ║рЂІ рђАрђЁрђгрђИрђАрђърђ▒рђгрђђрђ║рђЋрђ╗рђђрђ║рђюрђгрђЎрђџрђ║рЂІ рђЂрђ▒рђФрђёрђ║рђИрђљрђйрђ▒рђђрђГрђ»рђђрђ║рђюрђгрђЎрђџрђ║рЂІ рђЮрђЎрђ║рђИрђюрђ╗рђЙрђ▒рђгрђљрђгрђљрђйрђ▒ рђќрђ╝рђЁрђ║рђюрђгрђљрђљрђ║рђЋрђФрђљрђџрђ║рЂІ</p>
<p><span class='_5mfr'><span class='_6qdm'>­ЪЉЅ</span></span>&nbsp;( 5 ) рђЏрђђрђ║рђЎрђ╝рђ▒рђгрђђрђ║рђћрђ▒рђи<br />рђюрђірђ║рђЋрђёрђ║рђИрђљрђйрђ▒ рђАрђЏрђЎрђ║рђИрђћрђгрђюрђгрђЎрђџрђ║рЂІ<br />рђАрђЁрђгрђИрђАрђърђ▒рђгрђђрђ║рђЁрђгрђИрђЏрђёрђ║рђљрђ▒рђгрђёрђ║ рђюрђірђ║рђЋрђёрђ║рђИрђћрђгрђюрђгрђЎрђџрђ║рЂІ рђЏрђ▒рђърђ▒рђгрђђрђ║рђЏрђёрђ║рђљрђ▒рђгрђёрђ║ рђюрђірђ║рђЋрђёрђ║рђИ рђћрђгрђюрђгрђЎрђџрђ║рЂІ рђЁрђђрђгрђИрђЋрђ╝рђ▒рђгрђЏрђёрђ║рђюрђірђ║рђИ рђюрђірђ║рђЋрђёрђ║рђИрђљрђйрђ▒ рђћрђгрђюрђгрђЎрђџрђ║рЂІ рђЂрђ╝рђ▒рђЉрђ▒рђгрђђрђ║рђљрђйрђ▒рђЋрђГрђ»рђЋрђ╝рђ«рђИ рђђрђГрђ»рђђрђ║рђЂрђ▓рђюрђгрђљрђџрђ║рЂІ рђюрђ░рђђ рђірђ▒рђгрђёрђ║рђИрђЋрђ╝рђ«рђИрђљрђ▒рђгрђи рђАрђгрђИрђћрђірђ║рђИрђюрђгрђЎрђџрђ║рЂІ</p>
<p><span class='_5mfr'><span class='_6qdm'>­ЪЉЅ</span></span>&nbsp;( 6 ) рђЏрђђрђ║рђЎрђ╝рђ▒рђгрђђрђ║рђћрђ▒рђи<br />рђАрђќрђ╗рђгрђИрђђ рђёрђйрђ▒рђирђёрђйрђ▒рђирђюрђ▒рђИрђЋрђ▓ рђЏрђЙрђГрђћрђ▒рђдрђИрђЎрђџрђ║рЂІ<br />рђюрђірђ║рђЂрђ╗рђ▒рђгрђёрђ║рђИрђљрђйрђ▒ рђАрђЏрђЎрђ║рђИрђћрђгрђюрђгрђЋрђ╝рђ«рђИ рђЂрђ╗рђ▒рђгрђёрђ║рђИ&zwnj;рђЂрђ╝рђ▒рђгрђђрђ║рђљрђйрђ▒ рђєрђГрђ»рђИрђюрђгрђЎрђџрђ║рЂІ рђАрђърђђрђ║рђЏрђЙрђ░рђЏрђљрђгрђЂрђђрђ║рђЂрђ▓рђЋрђ╝рђ«рђИ рђЎрђ▒рђгрђюрђгрђЎрђџрђ║рЂІ рђЂрђ╝рђ▒рђюрђђрђ║рђљрђйрђ▒ рђЋрђГрђ»рђЋрђ╝рђ«рђИрђђрђГрђ»рђђрђ║рђЂрђ▓рђюрђгрђЎрђџрђ║рЂІ</p>
<p><span class='_5mfr'><span class='_6qdm'>­ЪЉЅ</span></span>&nbsp;( 7 ) рђЏрђђрђ║рђЎрђ╝рђ▒рђгрђђрђ║рђћрђ▒рђи<br />рђАрђќрђ╗рђгрђИрђђ 100 рђђрђ╗рђ▒рђгрђ║рђюрђгрђЎрђџрђ║рЂІ<br />рђЂрђ╗рђ▒рђгрђёрђ║рђИрђљрђйрђ▒ рђАрђЏрђЎрђ║рђИрђєрђГрђ»рђИрђюрђгрђЎрђџрђ║рЂІ<br />рђърђюрђГрђЋрђ║рђљрђйрђ▒ рђЉрђйрђђрђ║рђюрђгрђЎрђџрђ║рЂІ</p>
<p><span class='_5mfr'><span class='_6qdm'>­ЪЉЅ</span></span>&nbsp;( 8 ) рђЏрђђрђ║рђЎрђ╝рђ▒рђгрђђрђ║рђћрђ▒рђи<br />рђюрђ░рђђ рђюрђ»рђХрђИрђЮ рђАрђгрђИрђЎрђЏрђЙрђГрђљрђ▒рђгрђирђърђюрђГрђ»рђќрђ╝рђЁрђ║рђЋрђ╝рђ«рђИрђљрђ▒рђгрђи рђАрђЏрђЎрђ║рђИрђћрђ»рђХрђИрђюрђгрђЎрђџрђ║рЂІ рђАрђЏрђЎрђ║рђИрђЎрђ▒рђгрђюрђгрђЎрђџрђ║рЂІ рђЏрђёрђ║рђўрђљрђ║рђљрђйрђ▒ рђАрђЏрђЎрђ║рђИрђАрђ▒рђгрђёрђ║рђирђюрђгрђЎрђџрђ║рЂІ рђЂрђХрђЁрђгрђИрђЏрђљрђ▓рђирђЮрђ▒рђњрђћрђгрђљрђйрђ▒ рђЋрђГрђ»рђєрђГрђ»рђИрђюрђгрђЎрђџрђ║рЂІ рђЂрђ╝рђ▒рђєрђЁрђ║рђюрђђрђ║рђєрђЁрђ║рђљрђйрђ▒ рђАрђЏрђЎрђ║рђИрђђрђГрђ»рђђрђ║рђЋрђ╝рђ«рђИ рђюрђірђ║рђЋрђёрђ║рђИрђђрђюрђірђ║рђИ рђАрђЏрђЎрђ║рђИрђћрђгрђюрђгрђЎрђџрђ║рЂІ</p>
